css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #333333;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #e79536;
}
.header-view .icon-check {
  color: #28bd3e;
}
.header-view .icon-hourglass {
  color: #555555;
}
.header-view .icon-stop {
  color: #ff6158;
}
.script-view {
  overflow: scroll;
  max-height: 300px;
  height: auto;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #f0f0f0;
  color: #555555;
}
.script-view .stderr {
  color: #ff6158;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
